class Map extends React.Component{

    render(){

        return(

            <LoadScript
            googleMapsApiKey="AIzaSyCGX39_vj1YuXzup9jOmR29Iw_u_5Y4JQM"
            >
                <GoogleMap
                mapContainerStyle={containerStyle}
                center={center}
                zoom={10}
                >

                { /* Child components, such as markers, info windows, etc. */ }
                <></>
                </GoogleMap>
           </LoadScript>
        );
    }
}

export default Map;
